package net.jeeshop.services.manage.questionnaireResult.dao.impl;import java.util.List;import net.jeeshop.core.dao.BaseDao;import net.jeeshop.core.dao.page.PagerModel;import net.jeeshop.services.manage.questionnaireResult.bean.QuestionnaireResult;import net.jeeshop.services.manage.questionnaireResult.dao.QuestionnaireResultDao;public class QuestionnaireResultDaoImpl implements QuestionnaireResultDao {	private BaseDao dao;	public void setDao(BaseDao dao) {		this.dao = dao;	}	@Override	public PagerModel selectPageList(QuestionnaireResult e) {		return dao.selectPageList("manage.questionnaireResult.selectPageList",				"manage.questionnaireResult.selectPageCount", e);	}	@Override	public List selectList(QuestionnaireResult e) {		return dao.selectList("manage.questionnaireResult.selectList", e);	}	@Override	public QuestionnaireResult selectOne(QuestionnaireResult e) {		return (QuestionnaireResult) dao.selectOne(				"manage.questionnaireResult.selectOne", e);	}	@Override	public int delete(QuestionnaireResult e) {		return dao.delete("manage.questionnaireResult.delete", e);	}	@Override	public int update(QuestionnaireResult e) {		return dao.update("manage.questionnaireResult.update", e);	}	public int deletes(String[] ids) {		QuestionnaireResult e = new QuestionnaireResult();		for (int i = 0; i < ids.length; i++) {			e.setId(ids[i]);			delete(e);		}		return 0;	}	@Override	public int insert(QuestionnaireResult e) {		return dao.insert("manage.questionnaireResult.insert", e);	}	@Override	public int deleteById(int id) {		return dao.delete("manage.questionnaireResult.deleteById", id);	}		@Override	public QuestionnaireResult selectById(String id) {		return (QuestionnaireResult) dao.selectOne("manage.questionnaireResult.selectById", id);	}}